import React, {Component} from 'react';


class Navbar extends Component{

    render(){

        console.log(this.props);
        return(

            <div className={'navbar'}>

                <h1>Name: {this.props.name}</h1>
                <h1>Age: { this.props.age}</h1>


            </div>

        );
    }
}

export default Navbar;
